import './footer.scss';


function Footer() {




    return (
        <div id="footer">


            <div id="footer_content">
                <ul>
                    <li>Created by Ed Woulfe <a alot="Github link" href="github.com">Github</a></li>

                </ul>

            </div>



        </div>




    );
}

export default Footer;
